import React from 'react'
import Select from 'react-select';

export default (props) => (
    <Select
      options={props.options}
      theme={(theme) => ({
        ...theme,
        borderRadius: 0,
        colors: {
          ...theme.colors,
          primary25: 'hotpink',
          primary: 'black',
        },
      })}
    />
  );
